import React, { useState } from "react";
import "./App.css";

function App() {
  const [age, setAge] = useState("");
  const [gender, setGender] = useState("");
  const [bmi, setBmi] = useState("");
  const [children, setChildren] = useState("");
  const [isSmoker, setIsSmoker] = useState("");
  const [region, setRegion] = useState("");
  const [charges, setCharges] = useState(null);

  // Function to handle the form submission
  const handleSubmit = async () => {
    // Example data object to send (adjust as per your API's needs)
    const requestData = {
      age,
      gender,
      bmi,
      children,
      isSmoker,
      region,
    };

    try {
      // Simulating a request to an API
      // Here you can use fetch or axios to call your backend for the prediction
      const response = await fetch("https://your-api-url.com/predict", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(requestData),
      });

      const data = await response.json();

      // Assuming data.charges is returned from the API
      setCharges(data.charges);
    } catch (error) {
      console.error("Error fetching charges:", error);
      setCharges("Error calculating charges");
    }
  };

  return (
    <div className='App'>
      <span className='title' style={{ fontSize: 30 }}>
        Medical Insurance Cost Prediction
      </span>

      {/* Age Input */}
      <span className='title'>Enter Age:</span>
      <input
        type='number'
        value={age}
        onChange={(e) => setAge(e.target.value)}
        placeholder='30'
      />

      {/* Gender Selection */}
      <span className='title'>Gender</span>
      <label htmlFor='gender' className='title'>
        Select Gender:{" "}
      </label>
      <select
        id='gender'
        value={gender}
        onChange={(e) => setGender(e.target.value)}
      >
        <option value=''>--Please choose an option--</option>
        <option value='male'>Male</option>
        <option value='female'>Female</option>
      </select>

      {/* BMI Input */}
      <span className='title'>BMI:</span>
      <input
        type='number'
        value={bmi}
        onChange={(e) => setBmi(e.target.value)}
        placeholder='27.99'
      />

      {/* Number of Children */}
      <label htmlFor='children' className='title'>
        Number of Children:{" "}
      </label>
      <select
        id='children'
        value={children}
        onChange={(e) => setChildren(e.target.value)}
      >
        <option value=''>--Please choose an option--</option>
        {[0, 1, 2, 3, 4, 5].map((num) => (
          <option key={num} value={num}>
            {num}
          </option>
        ))}
      </select>

      {/* Smoker Status */}
      <label htmlFor='smoker' className='title'>
        Are you a smoker?{" "}
      </label>
      <select
        id='smoker'
        value={isSmoker}
        onChange={(e) => setIsSmoker(e.target.value)}
      >
        <option value=''>--Please choose an option--</option>
        <option value='yes'>Yes</option>
        <option value='no'>No</option>
      </select>

      {/* Region Selection */}
      <label htmlFor='region' className='title'>
        Select your region:{" "}
      </label>
      <select
        id='region'
        value={region}
        onChange={(e) => setRegion(e.target.value)}
      >
        <option value=''>--Please choose an option--</option>
        <option value='southeast'>Southeast</option>
        <option value='southwest'>Southwest</option>
        <option value='northeast'>Northeast</option>
        <option value='northwest'>Northwest</option>
      </select>

      {/* Submit Button */}
      <button onClick={handleSubmit}>Calculate Insurance Cost</button>

      {/* Displaying Charges */}
      {charges !== null && (
        <div>
          <h3>Predicted Charges: ${charges}</h3>
        </div>
      )}
    </div>
  );
}

export default App;
